import './navbar.css'
function Navbar(){
    return(
        <nav>
            <div className="left">
                <a>
                    <img src="/logo.png" alt=""/>
                </a>
            </div>
            <div className="right">Right</div>
        </nav>
    )
}

export default Navbar;
